import { BrowserRouter, Route, Routes } from "react-router-dom";
import MainPage from "./MainPage";
import LoginPage from "./LoginPage";
import Router from "./Router";

function App() {
  return (
    <div>
      <BrowserRouter>
          <Routes>
            <Route path="/LoginPage" exact={true} element={<LoginPage />} /></Routes>
          <MainPage />
      </BrowserRouter>
    </div>
  );
}

export default App;
